import React from "react";

const Banner = () => (
    <div className="jumbotron">
        <h2 className="mx-auto">Clicky Game!</h2>
        <h4 className="mx-auto">Click an image to earn points, game ends when any image is clicked more than once!</h4>
    </div>
);

export default Banner;
